export default function Programs() {
  return (
    <main className="main-content">
      <div className="container">
        <div className="card portal-card" style={{ textAlign: 'left' }}>
          <h2>Programs</h2>
          <p>Programs will be added later by me (Shuvendu).</p>
        </div>
      </div>
    </main>
  );
}
